import { BrowserRouter, Routes, Route} from 'react-router-dom';
import Header from './Components/Header/Header';
import Footer from './Components/Footer/Footer';
import Home from './Components/Home/Home';
import PitsaCard from './Components/InfoContent/PitsaCard/PitsaCard';
function App() {
  return (
    <div className="App">
      <Header/>
        <BrowserRouter>
        <Routes>
          <Route path='/' element={<Home/>}/>
          <Route path ='/pitsa' element={<PitsaCard/>}/>
        </Routes>
        <Footer/>
        </BrowserRouter>
    </div>
  );
}

export default App;
